  return (
    <div className="App">
      <Router>
        <Main path="/"/>
        <New path="/new"/>
        <View path="/pirate/:pirateId"/>
        {/* <Update path="/pirate/edit/:pirateId"/> */}
      </Router>

    </div>
  );
}

export default App;
